import React from "react";

function CardPage() {
  return (
    <div>
      <button
        className="back-button"
        onClick={() => {
          setOpen(false);
        }}
      ></button>
      <h2 className="popup__title">Настройки</h2>
    </div>
  );
}

export default CardPage;
